import React from 'react';
import { Link } from 'react-router-dom';
import Sidebar from './Sidebar';
import '../styles/Home.css';

const Home = () => {
  const categories = [
    {
      title: 'General Aptitude',
      items: ['Arithmetic Aptitude', 'Data Interpretation', 'Online Aptitude Test', 'Data Interpretation Test'],
    },
    // Add other categories here
  ];

  return (
    <div className="home-container">
      <Sidebar />
      <div className="main-content">
        <nav className="navbar">
          {/* Navbar content */}
        </nav>
        <div className="welcome-section">
          <h2>
            Welcome to <span className="highlight">AptitudeArc</span>
          </h2>
          <p>Aptitude questions and answers for your placement interviews and competitive exams!</p>
        </div>
        <div className="grid-container">
          {categories.map((category, index) => (
            <div key={index} className="grid-card">
              <h3>{category.title}</h3>
              <ul>
                {category.items.map((item, i) => (
                  <li key={i}>
                    <Link to={`/item/${item}`}>{item}</Link>
                  </li>
                ))}
              </ul>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Home;
